import styled from 'styled-components';

const LogForm = styled.div`
  .Login {
    width: 100%;
    height: 100%;
    display: flex;
    align-items: center;
    justify-content: center;
    .containers {
      border: 1px solid black;
      height: 400px;
      width: 300px;

      .content {
        display: flex;
        flex-direction: column;
      }
    }
  }
`;

export { LogForm };
